import React from 'react';

const User = ({ name, email, grade, reaction }) => {
    return (
        <div>
            <h2>User Data:</h2>
            <p>Name: {name}</p>
            <p>Email: {email}</p>
            <p>Grade: {grade}</p>
            <p>Reaction: {reaction}</p>
        </div>
    );
};

export default User;
